- input: "TEXT\x1CC00550038\x1C.TEXT\x1C\x1CF3N\x1CDuring this reporting period, Senate
    Conservative Fund, Madison Project and Club for Growth PAC acted as conduits for
    earmarked contributions.  This report discloses the contributions based on the
    date the contribution was received by the conduit and all related contributions
    are itemized consistent with 102.8(a), 110.6(c)(2) and AO 2008-08.  Disclosure
    of the conduit's specific information, the total funds transmitted to this Committee
    and the date of receipt of the funds are provided as memo entries on SA11AI.  Any
    itemized contributions from individuals that were included in the total funds
    received from the conduit reflect a reference to the FEC's Transaction ID for
    the corresponding conduit memo entry in the receipt description found under the
    receipt amount for the period.  The contribution limits of the conduits were not
    affected.  The conduit conformed to the requirements for transmittal of earmarked
    contributions pursuant to 102.8(a) and (c) and 110.6(c)(1)(iii).\n"
